import React from 'react';
import logo from '../img/tv.png';

const Header = () => {
  return (
    <header className="header">
        <div className="header-title">
            <img className="logo" src={logo}></img>
            <h2>Cinemaniac</h2>
        </div>
    </header>
  )
}

export default Header;
